@Sanjay_Dixit @JaipurDialogues Can you please define/explain the caste system in our Hindu religion?
How does I am identified as a dalit by birth?
Can you please explain why Sampoornand statue was purified by the so called economically rich (Brahmins)inaugurated by Mr Jagjivanram a poor (Dalit)Defence Minister

